const CustomDropdown = ({ data, optionLabel, onChangeHandle, defaultValue }) => {

   return (
      <div className='relative'>
         <label htmlFor="customDropdown" className='text-white'>Select an option:</label>
         <select id="customDropdown" onChange={onChangeHandle} value={defaultValue}
            className='p-2 border border-[#494C55] rounded-lg bg-transparent cursor-pointer' style={{ width: '200px'}}>
            {data.map(option => (
               <option key={option.value} value={option.value} className="text-white bg-[#37393F]">
                  {option.text}
               </option>
            ))}
         </select>
          </div>
   );
};

export default CustomDropdown
